import { Row, Col } from 'antd';
import './style-aboutCom.css';

function AboutCom(props) {
  return (
    <>
      <Row style={{ paddingTop: `150px`, paddingBottom: `97px ` }}>
        <Col
          xs={{ span: 8, offset: 0 }}
          sm={{ span: 8, offset: 0 }}
          md={{ span: 10, offset: 0 }}
          lg={{ span: 20, offset: 2 }}
        >
          <h1>WHO WE ARE</h1>
          <p>
            Co-founded by a group of entrepreneurs and Tech Enthusiasts,
            creating and co-founding new enterprises off the ground by
            leveraging their cumulative knowledge and resources that are shared
            among their ventures. Badia Ventures is a high-paced tech startup,
            where the product is the venture, the prototype is the business
            model, and ‘shipping code’ means perfect and timely execution.
          </p>
        </Col>
      </Row>
    </>
  );
}

export default AboutCom;
